INSERT INTO `sys_help_document` VALUES (123635512700567552, '主页', 'index', b'0', 1, 'M00/00/06/rBKidF6GH0qASk1wAAANpf6ebK018.html', 'http://47.106.110.85:8888/group1/M00/00/06/rBKidF6GH0qASk1wAAANpf6ebK018.html', b'0', NULL, 3493, '3.41 KB', '<p style=\"text-align:center\"><span style=\"font-size: 20px;\"><strong><span style=\"font-family: 宋体;\">国家石材数据库与官网</span></strong></span></p><p style=\"text-align:center\"><span style=\"font-family:宋体\">后台使用手册</span></p><p style=\"text-align:center\">&nbsp;</p><p class=\"MsoListParagraph\" style=\"margin-left:28px;text-align:left\">一、<span style=\"font:9px &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:宋体\">系统说明</span></p><p class=\"MsoListParagraph\" style=\"margin-left:28px;text-align:left\"><span style=\"font-family:宋体\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></p><p class=\"MsoListParagraph\" style=\"margin-left:28px;text-align:left\">二、<span style=\"font:9px &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:宋体\">系统登录</span></p><p class=\"MsoListParagraph\" style=\"margin-left: 28px; text-align: center;\"><span style=\"font-family:宋体\"><img src=\"http://47.106.110.85:8888/group1/M00/00/00/rBKidF3pjceAB53CAADNCqlxnMM135.jpg\" title=\"登录\" alt=\"登录.jpg\"/></span></p><p class=\"MsoListParagraph\" style=\"margin-left:28px;text-align:left\">三、<span style=\"font:9px &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:宋体\">系统模块</span></p><p class=\"MsoListParagraph\" style=\"margin-left:56px;text-align:left\">(一)<span style=\"font:9px &#39;Times New Roman&#39;\">&nbsp;&nbsp; </span><span style=\"font-family:宋体\">工作台</span></p><p class=\"MsoListParagraph\" style=\"margin-left:56px;text-align:left\">(二)<span style=\"font:9px &#39;Times New Roman&#39;\">&nbsp;&nbsp; </span><span style=\"font-family:宋体\">门户管理</span></p><p class=\"MsoListParagraph\" style=\"margin-left:56px;text-align:left\">(三)<span style=\"font:9px &#39;Times New Roman&#39;\">&nbsp;&nbsp; </span><span style=\"font-family:宋体\">质检管理</span></p><p class=\"MsoListParagraph\" style=\"margin-left:56px;text-align:left\">(四)<span style=\"font:9px &#39;Times New Roman&#39;\">&nbsp;&nbsp; </span><span style=\"font-family:宋体\">石材数据库</span></p><p class=\"MsoListParagraph\" style=\"margin-left:56px;text-align:left\">(五)<span style=\"font:9px &#39;Times New Roman&#39;\">&nbsp;&nbsp; </span><span style=\"font-family:宋体\">企业及用户</span></p><p class=\"MsoListParagraph\" style=\"margin-left:56px;text-align:left\">(六)<span style=\"font:9px &#39;Times New Roman&#39;\">&nbsp;&nbsp; </span><span style=\"font-family:宋体\">标准技术</span></p><p class=\"MsoListParagraph\" style=\"margin-left:56px;text-align:left\">(七)<span style=\"font:9px &#39;Times New Roman&#39;\">&nbsp;&nbsp; </span><span style=\"font-family:宋体\">系统管理</span></p><p class=\"MsoListParagraph\" style=\"margin-left:28px;text-align:left\">四、<span style=\"font:9px &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:宋体\">常见问题</span></p><p class=\"MsoListParagraph\" style=\"margin-left:28px;text-align:left\">五、<span style=\"font:9px &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:宋体\">其他说明</span></p><p><br/></p>', 123627755989630976, 2, 0, '123627755989630976/123635512700567552', 'admin/index', 1, '', '2019-11-30 04:08:57', '2020-04-03 01:22:17', 1, 'admin', 1, 'admin');
